function trackLocation($user)
{
    // Get the user's current location using their device's GPS
    $location = getCurrentLocation();

    // Save the location to the database
    $user->locations()->save($location);
}

// Define the routing function
function routeLocations($user)
{
    Route::get('/locations', function () {
        return $user->locations;
    });
}

// Define the exception handling function
function handleAsyncExceptions()
{
    // Register a global event listener to catch any unhandled exceptions thrown by Async tasks
    Async::listen(function ($exception) {
        // Log the error message and stack trace for debugging purposes
        logError($exception);
    });
}

// Define the main function that runs when the app starts up
function run()
{
    // Create a new user object if it doesn't exist in the database
    $user = User::firstOrCreate(['device_id' => '12345']);

    // Start tracking the user's location every 60 seconds
    Async::times(60, function () use ($user) {
        trackLocation($user);
    });

    // Route all requests to display the user's locations
    routeLocations($user);

    // Handle any unhandled exceptions thrown by Async tasks
    handleAsyncExceptions();
}

// Define the logError function that logs the error message and stack trace
function logError($exception)
{
    // Log the error to a file for debugging purposes
    error_log("Uncaught exception: " . $exception->getMessage(), E_ALL);
}

